import 'dart:convert';

import 'package:equatable/equatable.dart';

class Epub extends Equatable {
  final bool? isAvailable;
  final String? downloadLink;

  const Epub({this.isAvailable, this.downloadLink});

  factory Epub.(
    Map<String, dynamic> data,
  ) {
    return Epub(
      isAvailable: data['isAvailable'] as bool?,
      downloadLink: data['downloadLink'] as String?,
    );
  }

  Map<String, dynamic>
  () {
    return {'isAvailable': isAvailable, 'downloadLink': downloadLink};
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Epub].
  factory Epub.fromJson(String data) {
    return Epub.(
      json.decode(data) as Map<String, dynamic>,
    );
  }

  /// `dart:convert`
  ///
  /// Converts [Epub] to a JSON string.
  String toJson() => json.encode(
    (),
  );

  @override
  List<Object?> get props => [isAvailable, downloadLink];
}
